import React, { useEffect, useState } from "react";
import axios from "axios";
import { Container, Row, Col } from "react-bootstrap";
import Image from "react-bootstrap/Image";

export const Pokemon = () => {
  const [data, setData] = useState("");
  const [randomNum, setRandomNum] = useState(5);
  const [minVal, setMinVal] = useState(10);
  const [maxVal, setMaxVal] = useState(100);
  const [name, setName] = useState("");

  const URL = `https://api.imgflip.com/get_memes`;

  const hundleOnSumbit = (e) => {
    e.preventDefault();
    axios
      .get(URL)
      .then((res) => {
        setData(res.data.data.memes[randomNum]);
        setName(anecdotes[Math.floor(Math.random()*anecdotes.length)])
      })
      .catch((err) => console.log(err));
  };

  console.log(data);

  useEffect(() => {
    setRandomNum(Math.floor(Math.random() * (maxVal - minVal + 1) + minVal));
  });

  return (
    <div>
      <Container fluid>
        <form onSubmit={hundleOnSumbit}>
          <Row>
            <Col md={{ offset: 5 }}>
              <button type="submit" className="btn btn-danger">
                Generate
              </button>
            </Col>
          </Row>
        </form>
      </Container>

      <Container>
        <Row>
          <Col md={{ span: 8, offset: 4 }}>
            <h1> {data.name} </h1>
          </Col>
        </Row>
        <Row>
          <Col md={{ span: 8, offset: 4 }}>
            <h1> {name} </h1>
          </Col>
        </Row>
        <Row>
          <Col md={{ span: 7, offset: 3 }}>
            <Image src={data.url} fluid />
          </Col>
        </Row>
      </Container>
    </div>
  );
};
